ศูนย์เรื่องราวร้องทุกข์ ได้รับการประสานผ่านระบบการจัดการเรื่องราวร้องทุกข์ สำนักงานปลัดสำนักนายกรัฐมนตรี ทำเนียบรัฐบาล รหัสเรื่อง นร02660019512
ขอให้ปรับปรุงระบบการให้บริการทางโทรศัพท์ของสำนักงานเขตยานนาวา แขวงช่องนนทรี เขตยานนาวา กรุงเทพมหานคร หมายเลขโทรศัพท์ 02 294 2394, 02 294 2392, 02 294 2393 เนื่องจากวันที่ 11 พฤษภาคม 2566 ช่วงเวลาประมาณ 15.05 น. ผู้ร้องได้โทรศัพท์ติดต่อผ่านหมายเลขโทรศัพท์ดังกล่าว เพื่อสอบถามเกี่ยวกับการทำบัตรประจำตัวประชาชน ซึ่งผู้ร้องทำการติดต่อ จำนวน 3 ครั้ง ไม่มีเสียงสัญญาณโทรศัพท์ โดยมีเพียงหมายเลขโทรศัพท์ 02 294 2392 ที่มีสัญญาณโทรศัพท์แต่ไม่มีคนรับสาย ทำให้ผู้ร้องไม่สามารถติดต่อกับเจ้าหน้าที่ได้ ส่งผลให้ได้รับความเดือดร้อน จึงประสงค์ให้หน่วยงานที่เกี่ยวข้องควรปรับปรุงการให้บริการ เพื่ออำนวยความสะดวก ให้แก่ประชาชน (ผู้ร้องประสงค์ให้เปิดเผยชื่อ-นามสกุลและหมายเลขโทรศัพท์)
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
